        color,
        height,
        padding
    } = props

    return (
        <>
            <div className="row">
                <Column style={{
                    backgroundColor: color[0],
                    height: height,
                    padding: padding,
                }}
                    content={
                        <DistrictInfo title='WÃ¤hle einen Stadtteil aus.'/>                        
                    }
                />
                <Column style={{
                    backgroundColor: color[1],
                    height: height,
                    padding: padding,
                }}
                    content={'Diagramm'}
                />
                <Column style={{
                    backgroundColor: color[2],
                    height: height,
                    padding: padding,
